import React from 'react'

import { Link } from 'react-router-dom'

function Header()
{
    return(<>
    
                {/*React Links Calling*/}
              
                <nav className="navbar navbar-expand-lg py-3"
                 
                 style={
                     {
                         backgroundColor:'#475562',
                         borderBottom: '10px white',
                        }
                   }>
                  <div className="container-fluid">
          
                     
                    <div className="collapse nav-pills navbar-collapse justify-content-end" id="navbarNav">
                        

                        <div className= "navbar-nav">
                            <Link className="nav-link nav-item text-white mx-4 active" style={{fontSize:'18px'}}  a href="Spindex.html">HOME</Link>
                        
                            <Link className="nav-link nav-item text-white mx-5" style={{fontSize:'18px'}} href="Spabout.html">ABOUT</Link>

                            
                        
                        <Link className="nav-link nav-item text-white mx-5" style={{fontSize:'18px'}} href="Spservices.html">SERVICES</Link>
                
                            <Link className="nav-link nav-item text-white mx-5"style="font-size:18px;" href="Spcontact.html">CONTACT</Link>
                        </div>
                
          </div>
        </div>
      </nav>

                {/*React Links Calling*/} 

    </>)
}
export default Header;
